module.exports = "  <div class=\"flexbox-container-column flexbox-align-items-center\">\r\n    <span class=\"book-title large-text\">About Laurie Hanson</span>\r\n  </div>\r\n\r\n  <div class=\"photo-text flexbox-container-column\">\r\n\r\n    <p class=\"photo\">\r\n      Laurie Hanson has loved and owned dogs her entire life.  She has shown dogs all over the US and Canada.\r\n    </p>\r\n\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/5186_95142022855_4845894_n.jpg\" />\r\n      Laurie wanted to capture the joy and happiness that Treasure brought to her family.  A book was the perfect medium; and having Treasure be the focus of the story allows\r\n      the enthusiasm that Treasure felt every day to come through.  You can tell that Treasure wasn't just a dog; she was a teammate; a great friend and a joy to live with.\r\n    </p>\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/20150808_185250.jpg\" />\r\n      She and her Siberian Huskies and Golden\r\n      Retrievers have participated in obedience, agility, lure\r\n      coursing, therapy dog work, sled dog racing,\r\n      conformation showing, and tracking events.</p>\r\n\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/20140520_192932.jpg\" />\r\n      Laurie has been active in various All Breed Kennel Clubs and Breed Clubs, having served in various leadership roles over the years.  She has been active in 4-H, training young dog owners in\r\n      Rally, Agility and Obedience.  She's also been a judge both at the local county level and at the state level.\r\n    </p>\r\n\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/Scan.bmp.jpg\" />\r\n      In her free time she enjoys\r\n      reading and running. She recently qualified for the\r\n      Boston Marathon.</p>\r\n\r\n\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/1240445_10151982700497856_619320026_n.jpg\" />\r\n      Laurie and her husband live in Ramsey, Minnesota.  They have two children. Treasure was especially loved by their daughter.</p>\r\n\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/20140520_192932.jpg\" />\r\n      She currently has three Golden Retrievers who are all related to Treasure.</p>\r\n\r\n    <p class=\"photo\">\r\n      <img src=\"assets/img/735633_507507272623239_74297125_o.jpg\" />\r\n      <span>Treasure was born on her birthday!!!</span>\r\n    </p>\r\n\r\n\r\n\r\n  </div>\r\n"

