module.exports = "<div class=\"flexbox-container-column flexbox-align-items-center\">\r\n  <span class=\"book-title large-text\">Treasure</span>\r\n  <span class=\"dates\">\r\n            <span>12-28-2002</span><span> to </span><span>11-18-2013</span>\r\n    </span>\r\n</div>\r\n\r\n<div class=\"photo-text flexbox-container-column\">\r\n\r\n  <p>\r\n            <span>\r\n                Treasure was owned and trained by Jessica Hanson who trained and showed her as a junior handler.  Treasure competed in Agility, Obedience, Rally, Junior Showmanship,\r\n                breed competition, and tracking.  She was also a Therapy Dog.\r\n            </span>\r\n  </p>\r\n\r\n\r\n  <p class=\"photo left\">\r\n    <img src=\"assets/img/Treasure2.jpg\"/>\r\n    <span>She obtained her MACH, UDX and RAE titles.  She won two 1st places in Rally at the Golden Retriever Club of America National Specialties, one in 2005 and one in 2008.</span>\r\n  </p>\r\n\r\n  <p class=\"photo right\">\r\n    <img src=\"assets/img/Treasure_Agility.jpg\"/>\r\n    <span>Treasure won 1st place in Preferred Excellent Jumpers with Weaves at the 2010 GRCA National Specialty, and 1st place in Preferred Novice FAST (16\").</span>\r\n  </p>\r\n\r\n  <p class=\"photo\">\r\n    <img src=\"assets/img/image0.jpg\"/>\r\n    <span>She also had points towards her AKC Obedience Trial Championship.    Jessica was the first Junior Handler to put a Utility Dog title on a dog of any breed.</span>\r\n  </p>\r\n\r\n  <p class=\"photo left\">\r\n    <img src=\"assets/img/Treasure_ShowPhoto.jpg\"/>\r\n    She was a Canadian Champion and Canadian Obedience Trial Champion.\r\n  </p>\r\n\r\n  <p class=\"photo right\">\r\n    <img src=\"assets/img/1501372_10152101063792856_1229576899_o (2).jpg\"/>\r\n    Jessica and Treasure competed in Junior Showmanship at the Westminster Kennel Club in 2006. The were ranked #9\r\n    all-breed in the country for Junior Showmanship in 2007.\r\n    Jessica and Treasure were ranked #1 in the country in 2007 for Golden Retrievers for Junior Handler. They were\r\n    ranked #1 all-breed in Minnesota for several years.\r\n    They won multiple Champion awards at the Minnesota State 4-H Dog Shows.\r\n  </p>\r\n\r\n  <p>\r\n    <span>Jessica and Treasure competed in musical freestyle events.  They won first place at the Golden Retriever Club of America National Specialty in 2006 in the novice division.</span>\r\n    <span class=\"videoContainer\">\r\n    <iframe width=\"450\" height=\"283\" src=\"https://www.youtube.com/embed/W3YpBuK45KM?wmode=transparent&rel=0\"\r\n            frameborder=\"0\" allowfullscreen wmode=\"Opaque\"></iframe>\r\n  </span>\r\n  </p>\r\n\r\n\r\n  <p class=\"photo left\">\r\n    <img src=\"assets/img/Treasure_3M.jpg\"/>\r\n    Treasure was a dog model, and did dozens of photo shoots for Target, Best Buy, Blue Cross Blue Shield, 3M, Cargil\r\n    and many other companies.\r\n  </p>\r\n\r\n  <p>\r\n    <span>She appeared in a nationally-broadcast tv commercial for Dr. Foster and Smith</span>\r\n    <span class=\"videoContainer\">\r\n    <iframe width=\"450\" height=\"283\" src=\"https://www.youtube.com/embed/g1MdSmSSBM0?wmode=transparent&rel=0\"\r\n            frameborder=\"0\" allowfullscreen wmode=\"Opaque\"></iframe>\r\n  </span>\r\n  <span>and was in an informercial for Sunsetter Awnings.</span>\r\n    <span id=\"videoContainer\">\r\n      <iframe width=\"450\" height=\"283\"\r\n              src=\"https://www.youtube.com/embed/OZlTd3HMFxU?wmode=transparent&start=80&end=83&rel=0\" frameborder=\"0\"\r\n              allowfullscreen wmode=\"Opaque\"></iframe>\r\n    </span>\r\n  </p>\r\n\r\n  <p class=\"photo right\">\r\n    <img src=\"assets/img/Treasure_Laurie.jpg\"/>\r\n    She was truly an amazing dog, a wonderful companion, and now the star of a book!\r\n  </p>\r\n\r\n</div>\r\n"

